import React, { useState, useEffect } from "react";
import "../style/Results.css";

function App() {    

    const [time, setTime] = useState(288);
    const [cost, setCost] = useState(100);
    const [sortType, setSortType] = useState('cost');

    let master = [  ["A4546","Lufthansa","10:10","12:35",69,690,0],
                    ["A4546","RyanAir","10:10","12:35",93,262,0],
                    ["A4546","Lufthansa","10:10","12:35",145,98,0],
                    ["A4546","RyanAir","10:10","12:35",120,143,0],
                    ["A4546","Lufthansa","10:10","12:35",163,50,0],
                    ["A4546","RyanAir","10:10","12:35",88,420,0],
                    ["A4546","RyanAir","10:10","12:35",152,98,0]];
    let visible = [];

    function applyFilters(){
        visible = [];
        for (let i = 0; i < master.length; i++){
            if (master[i][4] <= time*5 && master[i][5] <= cost*10){
                visible.push(master[i]);
            }
        }
    }

    function resort(newSort){
        setSortType(newSort);
        if (sortType === 'cost'){
            master.sort(function compareFn(a, b) { 
                if (a[5] < b[5]){
                    return -1
                }
                else if (a[5] > b[5]){
                    return 1
                }
                else {
                    return 0
                }
            });
        }
        else if (sortType === 'time'){
            master.sort(function compareFn(a, b) { 
                if (a[4] < b[4]){
                    return -1
                }
                else if (a[4] > b[4]){
                    return 1
                }
                else {
                    return 0
                }
            });
        }
        else{
            master.sort(function compareFn(a, b) { 
                if (a[1] < b[1]){
                    return -1
                }
                else if (a[1] > b[1]){
                    return 1
                }
                else {
                    return 0
                }
            });
        }
        console.log(master);
    }

    function Test() {
        if (cost===69){
            return <h1>You are gay</h1>;
        }
        else if (cost===42){
            return <h1>Blaze it</h1>;
        }
        return;
    }

    function Results() {
        return visible.map(result => 
                <tr>
                <td>{result[0]}</td>
                <td>{result[1]}</td>
                <td>{result[2]}</td>
                <td>{result[3]}</td>
                <td>{parseInt(result[4]/60)} hr {result[4] % 60} min</td>
                <td>€{result[5]}</td>
                <td>{result[6]}</td>
                </tr>
            );
    }

    applyFilters();

    return (

        <div className="App">

            <div class="header" className="App-header">
                <h1>dinoSOAR</h1>
            </div>

            <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/css/bootstrap.min.css"/>
            <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.4/jquery.min.js"></script>
            <script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/js/bootstrap.min.js"></script>
            <script src="https://unpkg.com/vue@3/dist/vue.global.js"></script>

            <div className="App-body">
                <div class="container">
                    <h1>Filters:</h1>
                    <div class="row">
                        <div class="col-sm-6">
                            <div className="Slider">
                                <h2>Cost Limits</h2>
                                <p>Move the slider to choose how much you are willing to pay foryour trip.</p>
                                <input id="costRange"
                                    max={100}
                                    type="range"
                                    value={cost}
                                    onChange={(e) => setCost(e.target.valueAsNumber)}
                                />
                                <p>Maximum cost: €{cost*10}</p>
                                <Test/>
                            </div>
                        </div>
                        <div class="col-sm-6">
                            <div className="Slider">
                                <h2>Time Limits</h2>
                                <p>Move the slider to choose how long you are willing your trip to take.</p>
                                <input id="timeRange"
                                    max={288}
                                    type="range"
                                    value={time}
                                    onChange={(e) => setTime(e.target.valueAsNumber)}
                                />
                                <p>Maximum time: {parseInt(time*5/60)} hr {time*5 % 60} min</p>
                            </div>
                        </div>
                    </div>
                </div>
                <div class="container">
                    <button onClick={applyFilters}>
                        Refresh filters
                    </button>
                </div>
                <div class="container">
                    <h2>Sort results by...</h2>
                    <div class="col-sm-1">
                        <button onClick={() => resort('cost')}>
                            Cost
                        </button>
                    </div>
                    <div class="col-sm-1">
                        <button onClick={() => resort('time')}>
                            Time
                        </button>
                    </div>
                    <div class="col-sm-1">
                        <button onClick={() => resort('airline')}>
                            Airline
                        </button>
                    </div>
                </div>
                <div class="container">
                    <h1>Flight Results: currently showing {visible.length} flight options sorted by {sortType}.</h1>  
                    <table class="table table-bordered">
                        <thead>
                            <tr>
                                <th>Flight number</th>
                                <th>Airline</th>
                                <th>Departure Time</th>
                                <th>Arrival Time</th>
                                <th>Total Time</th>
                                <th>Total Cost</th>
                                <th># Layovers</th>
                            </tr>
                        </thead>
                        <tbody>
                            <Results 
                            number="A4546" 
                            airline="Lufthansa"
                            departure="10:10"
                            arrival="12:35"
                            time="2 hr 25 min"
                            cost="€98"
                            layovers="0"
                            />
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
}

export default App;
